import React from "react";
import {Pagination} from "@nextui-org/react";

export default function Paginations(sizes) {
  return (
    <>
      {sizes.map((size) => (
        <Pagination key={25} total={4} initialPage={1} size={25} />
      ))}
    </>
  );
}
